body {
  font-family: 'Lato', sans-serif;
  background-color: #0e1821;
  color: #dbd7d4;
  overflow: hidden;
  display: block;
}

/* Mobile first, baby! */
/* Extra small devices (phones, 600px and down) */
@media only screen and (max-width: 600px) {
  /*  LOGO */
  .logo > h1:first-child {
    height: 30px;
  }
  .logo {
    float: left;
    padding: 2px 0;
    display: block;
    text-decoration: none;
    padding: 8px 0;
    font-family: 'Permanent Marker', cursive;
    text-align: center;
    color: #fee970;
  }
  .logo .t {
    display: block;
    margin: -5px 30px 5px 10px;
    width: auto;
    height: auto;
    display: block;
    text-shadow: 0 0 8px #6a4cf1, 0 0 5px #dbd7d4;
  }
  .logo p {
    font-family: 'Permanent Marker', cursive;
    color: #dbd7d4;
    font-size: 9px;
    letter-spacing: 2px;
    bottom: 0;
    width: 100%;
    text-align: center;
  }
  /* Sidebar navigation */
  .sidebar {
    flex-direction: row;
    width: 100%;
    height: 60px;
    position: absolute;
    top: 0;
    left: 0;
    z-index: 3;
    min-height: 0;
    background-color: #131317;
  }
  .sidebar ul {
    display: none;
  }
  .sidebar .sidenav a b {
    display: none;
  }
  .sidebar nav.sidenav {
    left: 0;
    opacity: 1;
}
  .sidebar nav {
    width: 100%;
    position: fixed;
    left: 100%;
    opacity: 0;
    display: none;
    margin-left: 0;
    float: left;
    overflow: hidden;
    text-align: center;
    height: 60px;
    top: 60px;
    margin-top: 0;
    background: #131317;
    transition: all 0.3s ease-out;
  }
  .sidebar .sidenav a {
    float: left;
    margin-left: 0 !important;
    line-height: 60px;
    height: 60px;
    width: 20%;
    color: #909096;
  }
  .sidebar .sidenav a:hover,
  .sidebar .sidenav a:active {
    color: #fee970;
  }
  .mobile-link {
    font-size: 30px;
    color: #fff;
    float: right;
    margin: 10px 20px 10px 10px;
    display: block;
  }
  .mobile-link:hover {
    color: #fee970;
  }
}

